import { ImageResponse } from '@vercel/og';
import QRCode from 'qrcode';

export const config = {
  runtime: 'edge', 
};


const BACKGROUND_BASE64 = 'data:image/jpeg;base64,'; 

export async function onRequest(context) {
  const { searchParams } = new URL(context.request.url);
  const link = searchParams.get('text');

  if (!link) {
    return new Response('  text   ', { status: 400 });
  }

  // 1.   QR   Data URL
  //   Base64         fetch  
  const qrDataUrl = await QRCode.toDataURL(link, {
    width: 400,
    margin: 1,
    color: {
      dark: '#000000',
      light: '#ffffff00' //   QR 
    }
  });

  return new ImageResponse(
    (
      <div
        style={{
          display: 'flex',
          height: '100%',
          width: '100%',
          // **   Base64  **
          backgroundImage: `url(${BACKGROUND_BASE64})`, 
          backgroundSize: '100% 100%',
          justifyContent: 'center',
          alignItems: 'center',
        }}
      >
        <img
          src={qrDataUrl}
          style={{
            width: '450px', 
            height: '450px',
            marginTop: '50px', //   QR
          }}
        />
        
      </div>
    ),
    {
      width: 1080, //   
      height: 1080,
    },
  );
}
